-- ----------------------------
--  Table structure for `meeting`
-- ----------------------------
DROP TABLE IF EXISTS `meeting`;
CREATE TABLE `meeting` (
  `id` varchar(50) NOT NULL COMMENT '会议编码',
  `name` varchar(50) NOT NULL COMMENT '会议名称',
  `discribtion` varchar(500) DEFAULT NULL COMMENT '会议描述',
  `meetingDate` datetime NOT NULL COMMENT '会议时间',
  `site` varchar(200) NOT NULL COMMENT '会议地点',
  `division` varchar(50) NOT NULL COMMENT '会议部门',
  `comment` varchar(500) DEFAULT NULL COMMENT '说明',
  `pcode` varchar(50) DEFAULT NULL COMMENT '会议名称拼音码',
  `note` varchar(500) DEFAULT NULL COMMENT '注意事项',
  `owner` varchar(50) NOT NULL COMMENT '主持人',
  `category` varchar(50) DEFAULT NULL COMMENT '会议类型',
  `cvalue` int(11) DEFAULT NULL COMMENT '当前会议所属月/周',
  `status` varchar(50) DEFAULT NULL COMMENT '会议状态',
  `createUserId` varchar(50) NOT NULL COMMENT '创建人编码',
  `createUserName` varchar(50) NOT NULL COMMENT '创建人姓名',
  `createDate` datetime NOT NULL COMMENT '入库日期',
  `lastModifyUserId` varchar(50) DEFAULT NULL COMMENT '最后更新人编码',
  `lastModifyUserName` varchar(50) DEFAULT NULL COMMENT '最后更新人姓名',
  `lastModifyDate` timestamp NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '最后更新时间',
  PRIMARY KEY (`id`),
  KEY `fk_meeting_dept_id_idx` (`division`),
  CONSTRAINT `fk_meeting_dept_id` FOREIGN KEY (`division`) REFERENCES `portal`.`department` (`department_id`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='会议(meeting)';

