-- ----------------------------
--  Table structure for `tpa`
-- ----------------------------
DROP TABLE IF EXISTS `tpa`;
CREATE TABLE `tpa` (
  `id` varchar(50) NOT NULL COMMENT '编码',
  `meetingId` varchar(50) NOT NULL COMMENT '会议编码',
  `topicId` varchar(50) NOT NULL COMMENT '议题编码',
  `normId` varchar(50) NOT NULL COMMENT '指标编码',
  `productId` varchar(50) NOT NULL COMMENT '产品编码',
  `probDiscri` varchar(500) NOT NULL COMMENT '问题描述',
  `probAnsys` varchar(500) NOT NULL COMMENT '原因分析',
  `actions` varchar(500) NOT NULL COMMENT '改善措施',
  `liable` varchar(50) NOT NULL COMMENT '责任人',
  `deptId` varchar(50) NOT NULL COMMENT '归属部门',
  `status` varchar(50) NOT NULL DEFAULT '1' COMMENT '任务状态',
  `createUserId` varchar(50) NOT NULL COMMENT '创建人编码',
  `createUserName` varchar(50) DEFAULT NULL,
  `createDate` datetime DEFAULT NULL COMMENT '实际完成时间',
  `lastModifyUserId` varchar(50) DEFAULT NULL COMMENT '最后更新人编码',
  `lastModifyUserName` varchar(50) DEFAULT NULL COMMENT '最后更新人姓名',
  `lastModifyDate` timestamp NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '计划完成时间',
  PRIMARY KEY (`id`),
  KEY `fk_tpa_meeting_id_idx` (`meetingId`),
  KEY `fk_tpa_topic_id_idx` (`topicId`),
  KEY `fk_tpa_norm_id_idx` (`normId`),
  CONSTRAINT `fk_tpa_meeting_id` FOREIGN KEY (`meetingId`) REFERENCES `meeting` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `fk_tpa_norm_id` FOREIGN KEY (`normId`) REFERENCES `norm` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `fk_tpa_topic_id` FOREIGN KEY (`topicId`) REFERENCES `topic` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='TOP问题分析(tpa)';

